import React from "react";
import "./Selector.css";
import course from "../../pages/Course";

const Selector = (props) => {
    const { courses, selectedCourse, onSelectChange } = props;

    return (
        <div className="selector">
            <select value={selectedCourse} onChange={onSelectChange}>
                {
                    courses.map((course))
                }
            </select>
        </div>
    );
}

export default Selector;
